import React from "react";

class Users extends React.Component {
  users = [
    {
      id: 1,
      firstname: "Bob",
      lastname: "Marley",
      bio: "clboiegp epchege ehcpgehpb  pehchp",
      age: 40,
      isHappy: true,
    },
    {
      id: 2,
      firstname: "Jonh",
      lastname: "Doe",
      bio: "c;keo cebb ecohegv cbeogw bceg9g0wuey9 egc9gh",
      age: 22,
      isHappy: false,
    },
  ];
  render() {
    if (this.users.length > "")
      return (
        <div>
          {this.users.map((el) => (
            <div className="user" key={el.id}>
              <h3>
                {el.firstname} {el.lastname}
              </h3>
              <p3>{el.bio}</p3>
            </div>
          ))}
        </div>
      );
  }
}

export default Users;
